"use strict";

function maxProduct(nums) {
    let maxf = nums[0];
    let minf = nums[0];
    let res = nums[0];
    for (let i = 1; i < nums.length; i++) {
        let num = nums[i];
        let m = maxf;
        let n = minf;
        maxf = Math.max(num, m * num, n * num);
        minf = Math.min(num, m * num, n * num);
        res = Math.max(res, maxf);
    }
    return res;
}
